function Lessons ( {data, title} ) {

  return (
    <div className="content">
      {data.map((dataElement) => {
        if (dataElement.department === title) {
          return(
            <Card title={dataElement.name}/>
          )
        }
      })
      }
    </div>
  )
}

export default Lessons;
